"use strict";{const defaultTemplate='\n    <webui-data data-page-title="Page Not Found" data-page-subtitle="{PAGE_PATH}">\n        <template slot="json" name="page-next-page">\n            {\n                "name":"Home",\n                "href":"/"\n            }\n        </template>\n    </webui-data>\n    <webui-side-by-side elevation="10">\n        <webui-flex column justify="center" data-subscribe="app-not-found:html">\n            <p>The page you are looking for was not found!</p>\n        </webui-flex>\n        <webui-flex column justify="center">\n            <img src="https://cdn.myfi.ws/v/Vecteezy/404-error-illustration-exclusive-design-inspiration.svg" alt="Page Not Found Graphic" />\n        </webui-flex>\n    </webui-side-by-side>\n    ';webui.define("webui-page-not-found",{connected:async t=>{if(t.innerHTML)return;let html=webui.getData("app-not-found-html");t.innerHTML=html?webui.trimLinePreTabs(html):webui.trimLinePreTabs(defaultTemplate)}})}